const solution = (nums) => {
  let prefix = [];
  let suffix = [];
  let res = [];

  for (let i=0; i<nums.length; i++) {
    if (i === 0) {
      prefix[i] = 1;
    } else {
      prefix[i] = prefix[i-1] * nums[i-1]
    } 
  }

  for (let i = nums.length-1; i >= 0; i--) {
    if (i === nums.length - 1) {
      suffix[i] = 1;
    } else {
      suffix[i] = suffix[i+1] * nums[i+1]
    }
  }

  let index = 0;
  // console.log(prefix)
  // console.log(suffix)
  while (index <nums.length) {
    res[index] = prefix[index] * suffix[index];
    index += 1;
  }

  return res;
}

